import React, { Component } from "react";
import "./intro.css";
import profilePic from "../../../resources/pic/joey.JPG";

class Intro extends Component {
  state = {
    skills: {
      python: 80,
      javascript: 80
    }
  };
  render() {
    return (
      <div className="intro">
        <div className="split">
          <div className="container">
            <img className="profile" src={profilePic} alt="profile picture" />
            <h2>Xining (Joey) Wang</h2>
            <h3>Full Stack Developer</h3>
            <p>
              I am a developer based in Montreal, Canada. I have a passion for
              web development and algorithom.
            </p>
            <p>contact me for more detail</p>
          </div>
        </div>
        <div className="split">
          <p>
            I am a full stack developer based in Montreal, Canada. I have a
            passion for web development and I strive to be a better developer
          </p>
        </div>
      </div>
    );
  }
}

export default Intro;
